import React from "react";
import { auth, provider } from "../firebase";
import { signInWithPopup } from "firebase/auth";
import { useNavigate } from "react-router-dom";

export default function FrontPage() {
    const navigate = useNavigate();

    const handleGoogleSignIn = async () => {
        try {
            await signInWithPopup(auth, provider);
            navigate("/dashboard");
        } catch (err) {
            console.error("Sign-in failed:", err);
            alert("Sign in failed.");
        }
    };

    return (
        <div className="min-h-screen flex flex-col justify-center items-center bg-gradient-to-r from-green-400 to-blue-500">
            <h1 className="text-5xl font-bold text-white mb-8">SymbAIosis</h1>
            <button
                onClick={handleGoogleSignIn}
                className="px-6 py-3 bg-white text-black rounded shadow hover:shadow-lg transition"
            >
                Sign in with Google
            </button>
            <p className="text-white mt-6 max-w-lg text-center">
                SymbAIosis helps companies identify waste-to-resource opportunities for communities and sustainability.
            </p>
        </div>
    );
}
